import time
from typing import Dict


class Solution:

    def string_in_sub(self, sub: str, t_map: Dict) -> bool:
        sub_map = {}
        for c in sub:
            if c in sub_map:
                sub_map[c] += 1
            else:
                sub_map[c] = 1

        for k in t_map.keys():
            if k in sub_map:
                if sub_map[k] < t_map[k]:
                    return False
            else:
                return False

        return True

    def minWindow(self, s: str, t: str) -> str:
        if len(s) < len(t):
            return ''

        t_map = {}
        for c in t:
            if c in t_map:
                t_map[c] += 1
            else:
                t_map[c] = 1

        min_sub = ''
        left = 0

        for right in range(len(t), len(s) + 1):
            sub_str = s[left:right]
            while self.string_in_sub(sub_str, t_map):
                if len(min_sub) > len(sub_str) or min_sub == '':
                    min_sub = sub_str
                left += 1
                sub_str = s[left:right]

        return min_sub


